    "Pacific Remote Islands MNM: Initial Survey Instructions for Terrestrial Plant
    Observations",nt"tracking_summary": {ntt"total": 7,ntt"recent": 2nt},nt"groups":
    [],nt"relationships_as_subject": [],nt"revision_timestamp": "2016-07-27T23:05:59.160208",nt"name":
    "pacific-remote-islands-mnm-initial-survey-instructions-for-terrestrial-plant-observations",nt"isopen":
    false,nt"url": null,nt"notes": "The purpose of the terrestrial plant observations
    survey is to document vegetation species presence/absence and distribution on the
    island unit of the refuge. The surveys primarily supportObjective 1b (Increase baseline
    information on terrestrial habitat) in the CCPs of Howland Island, BakerIsland,
    and Jarvis Island NWRs. Tracking the general condition and diversity of vegetation
    that providesnesting habitat and shelter for seabirds and other migratory birds
    improves understanding of trends inseabird populations utilizing the refuges. The
    survey therefore also supports Objective 1a (Conserve,manage, and protect habitat
    for nesting seabirds) in the CCPs. These two objectives, in turn, pertain tothe
    goal of conserving, protecting, and managing native terrestrial habitats that are
    representative ofremote tropical Pacific islands, primarily for the benefit of seabirds.
    Additionally, detecting the presenceof invasive plant species, which likely have
    been accidentally introduced, may serve as an indication ofillegal trespass. If
    detected, introduced plants that may become highly invasive may trigger management
    actions to control.",nt"license_title": "License Not Specified",nt"extras":
